window.bookSummaryJSON = "<p><b>A secret like this doesn't keep itself....</b> </p> <p><i>Not Alone: First Encounter</i> is a prequel to the globally acclaimed Not Alone series, set several years before two worlds collide under the weight of the grandest conspiracy of all time. </p> <p>For the first time ever, <i>First Encounter</i> lifts the curtain on a deadly series of events surrounding the initial meeting between the ruthless Richard Walker - untouchable head of the controversial Interspace Defense Agency - and a young truth-seeker from Birchwood, Colorado.... </p> <p><i>Not Alone: First Encounter</i> is also available as part of the 10-story <i>Not Alone: Origins</i> collection.</p> <p><i>Not Alone</i> is a multi-time Kindle Unlimited All Star title and Audible.com Best of 2016 finalist. Dive in now to this roller coaster tale of contact and disclosure for the 21st century!</p>"; 
